import React, { useState } from "react";
import "./Fos.css";

const faszsagok = [
  "pina",
  "fasz",
  "fos",
  "geci",
  "pisa",
  "segglyuk",
  "seggpina",
  "hugyospite",
  "gecilyuk",
  "zsido",
];

const handleClick = () => {
  useState(() => {}, []);
};

const Fos = (props) => {
  return (
    <button onClick={handleClick} className="fos">
      {props.children}
    </button>
  );
};

export default Fos;
